INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'hellow', 0, 1, 1, 'und', 0, 'La prinicpal acción para la optimización de Drupal es el trabajo con la caché en todas las capa de la pila que componen la aplicación. El primer paso es activar la caché de Drupal y el comprimir los ficheros css y Js. Otras acciones importantes que se pueden realizar son: la incorporación de Varnish y la optimización de la interface en post de reducir la cantidad de peticiones al servidor y el tamaño de los css. Para ello conviene emplear técnicas como los sprite de imágenes y el uso Less para los css. ', '', 'plain_text');
